import styled from "styled-components"

const Footer = styled.div`
    margin-top:100px;
    width:100%;
    display:flex;
    height:300px;
    color:white;
    background-color:#214142;
    justify-content:center;
    align-items:center;
    text-align:center;
    .logo{
        margin:15px 0;
    }
`
export default Footer
